import User from "./User";
import"./App.css"
function person() {
  return (
    <div className="row">
      <User name="rafi" age="23" address="kabul khair khana" />
      <User name="sulaiman" age="13" address="kabul khair khana" />
      <User name="jawid" age="323" address="kabul khair khana" />
    </div>
  );
}
export default person;
